var React = require('react-native');
var Platform = React.Platform;
var user_default_avatar ='data:image/png;base64,';
var loading_image = "data:image/png;base64,"
var cookbook_default_image = 'data:image/png;base64,';
var detailHeadImageMask = 'data:image/png;base64,';
var cookbook_custom_icon = 'data:image/png;base64,'
var myCkListInvalidate_icon ='data:image/png;base64,';
var animationImages = function(){
    var imgs = [];
    for(var i = 1; i <= 24; i++){
        imgs.push('img:loading200x200-' + i);
    }
    return imgs;
}

var loading_gif = function(width, height, styles){
    styles = styles || {};
   if(Platform.OS == 'android'){
        // var ProgressBar = require('ProgressBarAndroid');
        // return <ProgressBar style={[styles, {width: width, height: height}]} />;
        var LoadingView = React.requireNativeComponent("LoadingView");
        if(LoadingView){
            return <LoadingView style={{width:width, height:height}} /> 
        }
        return null;
    }else{
        var AKRNImageAnimation = React.requireNativeComponent('AKRNImageAnimation', null);
        return <AKRNImageAnimation
                  animationRepeatCount={10}
                  animationDuration={120}
                  animationImages={animationImages()}
                  style={[styles, {width: width, height: height}]} />
    }
}
module.exports = {
	user_default_avatar:user_default_avatar,
    loading_image: loading_image,
    cookbook_default_image: cookbook_default_image,
    loading_gif: loading_gif,
    detailHeadImageMask:detailHeadImageMask,
    cookbook_custom_icon:cookbook_custom_icon,
    myCkListInvalidate_icon:myCkListInvalidate_icon
}